import React, { useState } from 'react';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import 'bootstrap/dist/css/bootstrap.min.css';

const FarmerDashboard = () => {
  const [farmer, setFarmer] = useState({
    name: 'John Doe',
    email: 'johndoe@example.com',
    phone: '123-456-7890',
  });

  const [isEditing, setIsEditing] = useState(false);

  const validateForm = () => {
    if (!farmer.name || !farmer.email || !farmer.phone) {
      toast.error('All fields are required!');
      return false;
    }
    if (!/\S+@\S+\.\S+/.test(farmer.email)) {
      toast.error('Please enter a valid email address!');
      return false;
    }
    if (!/^\d{3}-\d{3}-\d{4}$/.test(farmer.phone)) {
      toast.error('Please enter a valid phone number (e.g. 123-456-7890)');
      return false;
    }
    return true;
  };

  const handleEditProfile = () => {
    setIsEditing(true);
  };

  const handleLogout = () => {
    toast.success('Logged out successfully!');
  };

  const handleSaveProfile = () => {
    if (validateForm()) {
      setIsEditing(false);
      toast.success('Profile saved successfully!');
    }
  };

  return (
    <div className="container mt-5">
      <div className="row">
        {/* Farmer Profile in Right Upper Corner */}
        <div className="col-md-12 text-right mb-3">
          <div className="dropdown">
            <button className="btn btn-secondary dropdown-toggle rounded-circle p-3" type="button" id="profileDropdown" data-bs-toggle="dropdown" aria-expanded="false">
              <span className="h3 text-white">{farmer.name[0]}</span> {/* Display first letter of the name */}
            </button>
            <ul className="dropdown-menu" aria-labelledby="profileDropdown">
              {isEditing ? (
                <div className="dropdown-item">
                  <input
                    type="text"
                    className="form-control mb-2"
                    value={farmer.name}
                    onChange={(e) => setFarmer({ ...farmer, name: e.target.value })}
                  />
                  <input
                    type="email"
                    className="form-control mb-2"
                    value={farmer.email}
                    onChange={(e) => setFarmer({ ...farmer, email: e.target.value })}
                  />
                  <input
                    type="text"
                    className="form-control mb-2"
                    value={farmer.phone}
                    onChange={(e) => setFarmer({ ...farmer, phone: e.target.value })}
                  />
                  <button className="btn btn-primary w-100" onClick={handleSaveProfile}>
                    Save Profile
                  </button>
                </div>
              ) : (
                <div>
                  <li className="dropdown-item">
                    <strong>{farmer.name}</strong>
                  </li>
                  <li className="dropdown-item">{farmer.email}</li>
                  <li className="dropdown-item">{farmer.phone}</li>
                  <button className="dropdown-item" onClick={handleEditProfile}>
                    Edit Profile
                  </button>
                  <button className="dropdown-item text-danger" onClick={handleLogout}>
                    Logout
                  </button>
                </div>
              )}
            </ul>
          </div>
        </div>

        {/* Market Rates Table */}
        <div className="col-md-12">
          <div className="card p-4 shadow">
            <h2 className="text-center">Market Rates</h2>
            <table className="table table-bordered mt-3">
              <thead>
                <tr>
                  <th>Crop</th>
                  <th>Rate per Kg</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>Tomato</td>
                  <td>$2.5</td>
                </tr>
                <tr>
                  <td>Potato</td>
                  <td>$1.8</td>
                </tr>
                <tr>
                  <td>Carrot</td>
                  <td>$3.0</td>
                </tr>
              </tbody>
            </table>
          </div>
        </div>
      </div>

      {/* Toastify Notifications */}
      <ToastContainer />
    </div>
  );
};

export default FarmerDashboard;
